IF OBJECT_ID('dbo.proc_transform_135', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_135;
GO
CREATE PROCEDURE dbo.proc_transform_135
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_135
    SET payload = LEFT(payload, 1000) + N'|V4-135|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_135;
END
